import React from 'react';
import { Button, Modal, ModalBody, ModalFooter, ModalHeader } from 'react-bootstrap';


type GameOverDialogProps = {
    show: boolean
    result: string,
    handleReset: () => void,
    handleClose: () => void,
}

const GameOverDialog: React.FC<GameOverDialogProps> = ({ show, result, handleReset, handleClose }: GameOverDialogProps) => {
    const handleRematch = () => {
        handleClose();
        handleReset();
    };

    return (
        <Modal show={show} onHide={handleClose} >
            <ModalHeader closeButton>
                <Modal.Title>
                    Game over!
                </Modal.Title>
            </ModalHeader>
            <ModalBody>
                ${result}
            </ModalBody>
            <ModalFooter>
                <Button variant="secondary" onClick={handleClose}>
                    Analyse Game
                </Button>
                <Button variant="dark" onClick={handleRematch}>
                    Rematch
                </Button>
            </ModalFooter>
        </Modal>
    );
};

export default GameOverDialog;
